namespace BlogToolkit.Service
{

    public class BlogPostService
    {

        public List<BlogPost> GetPosts()
        {
            return new List<BlogPost>()
            {
                new BlogPost(
                    Guid.NewGuid(), 
                    "Indonesia", 
                    "Content for post 1",
                    "data:image/jpg;base64,",
                    "John Doe",
                    "Prepare to be immersed in the fascinating tapestry of Indonesia, a nation comprising over 17,000 islands and boasting a rich cultural heritage. Did you know that Indonesia is home to the world's largest volcanic lake, Lake Toba, formed by a colossal eruption thousands of years ago? Explore the ancient Borobudur Temple, a UNESCO World Heritage site and the largest Buddhist temple globally, offering a glimpse into Indonesia's historical grandeur. With over 300 ethnic groups and 700 languages spoken, Indonesia is a mosaic of diverse traditions and languages.", 
                    DateTimeOffset.Now
                    ),
                new BlogPost(
                    Guid.NewGuid(), 
                    "Tenerife", 
                    "Content for post 2",
                    "data:image/jpg;base64,",
                    "Jane Dee",
                    "Tenerife's landscape is a breathtaking canvas of diversity, ranging from the lunar-like expanse of the Teide National Park to the verdant valleys of the Anaga Rural Park. The island's centerpiece, Mount Teide, towers majestically as Spain's highest peak, surrounded by a surreal moonscape of volcanic craters and lava fields. Coastal beauty unfolds with dramatic cliffs, pristine beaches, and quaint villages, creating a captivating mosaic that showcases Tenerife's remarkable geological and natural wonders.", 
                    DateTimeOffset.Now.AddDays(-1))
            };
        }
    }

    public record BlogPost(
        Guid id,
        string Title,
        string Content,
        string ImageUrl,
        string Author,
        string Introduction,
        DateTimeOffset Date
    );

}


